  return (
    <div className="row justify-center">
      <div className="col">
        <h2 style={{ font: "40px" }}>My Cart</h2>
        {cartItems.map((items) => {})}
        <div className="flex-container">
          <div>Price: </div>
          <div>Quantity:</div>
          <div></div>
          <div></div>
        </div>
      </div>
    </div>
  );
}
